			void ExpressionVisitor::VisitField(WfLetVariable* node)
			{
				if (!node) return;
				Traverse(static_cast<WfLetVariable*>(node));
				Traverse(static_cast<vl::parsing::ParsingTreeCustomBase*>(node));
				Traverse(node->name);
				VisitField(node->value.Obj());
			}

